import React from 'react';
import Menus from '../../menus'
const Menu = () => {
    const menus = Menus
    return(
        <div className="menu-area">
            <div className="menu-box">
                <div className="title-box">
                    <h2 className="title">Menu</h2>
                </div>
                <div className="content-box">


                    <table>
                        <tbody>
                            <tr>
                                {menus.map((e) =>{
                                    return (
                                        <th>{e.name}</th>

                                    )
                                })}
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
}

export default Menu;
